'use strict';(function(){'use strict';function a(){var d=document.getElementById('link');axios.get('/api/?link='+d.value).then(function(e){b(e.data)}).catch(function(e){console.log(e),alert('Server unavailable')})}function b(d){document.getElementById('title').innerText=d.data.title,document.getElementById('uploaded').innerHTML='<strong>Uploaded by:</strong> '+d.data.uploaded,document.getElementById('length').innerHTML='<strong>Length:</strong>  '+d.data.length,document.getElementById('asmp3').href='download/mp3/'+d.v,document.getElementById('asmp4').href='download/mp4/'+d.v,document.getElementById('asmp4muted').href='download/mp4/'+d.v+'/muted',document.getElementById('card').style.display='block'}var c=document.getElementById('form');c.addEventListener('submit',function(d){d.preventDefault(),a()})})();